"""
The `JSON` scalar type represents JSON values as specified by [ECMA-404](http://www.ecma-international.org/publications/files/ECMA-ST/ECMA-404.pdf).
"""
scalar JSON

type Match {
  id: ID!
  created_at: DateTime!
  updated_at: DateTime!
  stage: String
}

type Matchcoucou {
  id: ID!
  created_at: DateTime!
  updated_at: DateTime!
  stage: String
}

input MatchcoucouInput {
  stage: String
}

input MatchInput {
  stage: String
}

union Morph = UsersPermissionsMe | UsersPermissionsMeRole | Match | createMatchPayload | updateMatchPayload | deleteMatchPayload | Matchcoucou | createMatchcoucouPayload | updateMatchcoucouPayload | deleteMatchcoucouPayload | UploadFile | UsersPermissionsPermission | UsersPermissionsRole | createRolePayload | updateRolePayload | deleteRolePayload | UsersPermissionsUser | createUserPayload | updateUserPayload | deleteUserPayload

type Mutation {
  createMatch(input: createMatchInput): createMatchPayload
  updateMatch(input: updateMatchInput): updateMatchPayload
  deleteMatch(input: deleteMatchInput): deleteMatchPayload
  createMatchcoucou(input: createMatchcoucouInput): createMatchcoucouPayload
  updateMatchcoucou(input: updateMatchcoucouInput): updateMatchcoucouPayload
  deleteMatchcoucou(input: deleteMatchcoucouInput): deleteMatchcoucouPayload

  """Create a new role"""
  createRole(input: createRoleInput): createRolePayload

  """Update an existing role"""
  updateRole(input: updateRoleInput): updateRolePayload

  """Delete an existing role"""
  deleteRole(input: deleteRoleInput): deleteRolePayload

  """Create a new user"""
  createUser(input: createUserInput): createUserPayload

  """Update an existing user"""
  updateUser(input: updateUserInput): updateUserPayload

  """Delete an existing user"""
  deleteUser(input: deleteUserInput): deleteUserPayload
  upload(refId: ID, ref: String, source: String, file: Upload!): UploadFile!
}

type Query {
  match(id: ID!): Match
  matches(sort: String, limit: Int, start: Int, where: JSON): [Match]
  matchcoucou(id: ID!): Matchcoucou
  matchcoucous(sort: String, limit: Int, start: Int, where: JSON): [Matchcoucou]
  files(sort: String, limit: Int, start: Int, where: JSON): [UploadFile]
  role(id: ID!): UsersPermissionsRole

  """
  Retrieve all the existing roles. You can't apply filters on this query.
  """
  roles(sort: String, limit: Int, start: Int, where: JSON): [UsersPermissionsRole]
  user(id: ID!): UsersPermissionsUser
  users(sort: String, limit: Int, start: Int, where: JSON): [UsersPermissionsUser]
  me: UsersPermissionsMe
}

input RoleInput {
  name: String!
  description: String
  type: String
  permissions: [ID]
  users: [ID]
}

input updateMatchcoucouInput {
  where: InputID
  data: editMatchcoucouInput
}

type updateMatchcoucouPayload {
  matchcoucou: Matchcoucou
}

input updateMatchInput {
  where: InputID
  data: editMatchInput
}

type updateMatchPayload {
  match: Match
}

input updateRoleInput {
  where: InputID
  data: editRoleInput
}

type updateRolePayload {
  role: UsersPermissionsRole
}

input updateUserInput {
  where: InputID
  data: editUserInput
}

type updateUserPayload {
  user: UsersPermissionsUser
}

"""The `Upload` scalar type represents a file upload."""
scalar Upload

type UploadFile {
  id: ID!
  created_at: DateTime!
  updated_at: DateTime!
  name: String!
  hash: String!
  sha256: String
  ext: String
  mime: String!
  size: String!
  url: String!
  provider: String!
  public_id: String
  related(sort: String, limit: Int, start: Int, where: JSON): [Morph]
}

input UserInput {
  username: String!
  email: String!
  provider: String
  password: String
  resetPasswordToken: String
  confirmed: Boolean
  blocked: Boolean
  role: ID
}

type UsersPermissionsMe {
  _id: ID!
  username: String!
  email: String!
  confirmed: Boolean
  blocked: Boolean
  role: UsersPermissionsMeRole
}

type UsersPermissionsMeRole {
  _id: ID!
  name: String!
  description: String
  type: String
}

type UsersPermissionsPermission {
  id: ID!
  type: String!
  controller: String!
  action: String!
  enabled: Boolean!
  policy: String
  role: UsersPermissionsRole
}

type UsersPermissionsRole {
  id: ID!
  name: String!
  description: String
  type: String
  permissions(sort: String, limit: Int, start: Int, where: JSON): [UsersPermissionsPermission]
  users(sort: String, limit: Int, start: Int, where: JSON): [UsersPermissionsUser]
}

type UsersPermissionsUser {
  id: ID!
  username: String!
  email: String!
  provider: String
  confirmed: Boolean
  blocked: Boolean
  role: UsersPermissionsRole
}
